sys_script_include.script:
var staffingOutreach = Class.create();
staffingOutreach.prototype = {
    initialize: function() {
    },
	details:function(){
		var records=this.getParameter('sysparm_value');
		var array=records.split(",");
		for(var i=0;i<array.length;i++){
			var time_keep=new GlideRecord("x_1331380_pro_bono_time_keeper_register");
			time_keep.get(array[i]);
			var gr=new GlideRecord("csm_consumer");
			gr.initialize();
			gr.name=time_keep.time_keeper_name;
			gr.email=time_keep.email;
			gr.insert();
		}



	},

    type: 'staffingOutreach'
};
